"  <div id=\"topicText\">",
"   <p class=\"headingAnchor\" id=\"H1\">",
"    <span class=\"h1\">",
"     INTRODUCTION",
"    </span>",
"    &nbsp;&mdash;&nbsp;Kinins are another set of hormones produced in the kidney [",
"    <a class=\"abstract\" href=\"UTD.htm?24/23/24945/abstract/1,2\">",
"     1,2",
"    </a>",
"    ]. The process begins with the secretion of the enzyme kallikrein by the cells in the distal tubule and connecting segment (",
"    <a class=\"graphic graphic_figure graphicRef74570 \" href=\"UTD.htm?25/31/26109\">",
"     figure 1",
"    </a>",
"    ). This enzyme catalyzes the conversion of inactive kininogen (a plasma protein that might also be produced locally) into lysyl-bradykinin and then, in the presence of an aminopeptidase, into bradykinin. Kinin generation probably occurs both in the tubular lumen and, since secreted kallikrein appears to reach the vascular compartment, in the vascular space. On the other hand, filtered kinins are rapidly metabolized by kininases in the proximal tubule and therefore are not likely to have any intratubular effect [",
"    <a class=\"abstract\" href=\"UTD.htm?24/23/24945/abstract/1\">",
"     1",
"    </a>",
"    ].",
"   </p>",
"   <p>",
"    The physiologic role of the renal kinins is incompletely understood. Like the prostaglandins, they are vasodilators that may act to minimize renal ischemia in hypovolemic states in which angiotensin II and norepinephrine secretion are increased [",
"    <a class=\"abstract\" href=\"UTD.htm?24/23/24945/abstract/3,4\">",
"     3,4",
"    </a>",
"    ]. Their site of production in the distal nephron also suggests that they may have an intraluminal effect on Na+ and water handling in the collecting tubules. Compatible with this hypothesis are the observations that kinins diminish Na+ reabsorption in the inner medulla (by closing Na+ channels in the luminal membrane) [",
"    <a class=\"abstract\" href=\"UTD.htm?24/23/24945/abstract/5\">",
"     5",
"    </a>",
"    ] and impair the ability of ADH to increase local water reabsorption [",
"    <a class=\"abstract\" href=\"UTD.htm?24/23/24945/abstract/6\">",
"     6",
"    </a>",
"    ]. The latter effect appears to be indirect, being mediated by kinin-induced prostaglandin production.",
"   </p>",
"   <p>",
"    Renal kinins appear to have a significant role in the developing kidney. The expression of bradykinin receptor mRNA is elevated 10- to 30-fold in neonatal kidney as compared with adult kidney [",
"    <a class=\"abstract\" href=\"UTD.htm?24/23/24945/abstract/7\">",
"     7",
"    </a>",
"    ]. How kinins act in the maturing kidney is unknown.",
"   </p>",
"   <p>",
"    The kinins are probably not important circulating hormones, since they are rapidly metabolized in the circulation by kininases, one of which is angiotensin converting enzyme. This is the same enzyme that catalyzes the conversion of angiotensin I into angiotensin II.",
"   </p>",
"   <p>",
"    (See",
"    <a class=\"medical medical_review\" href=\"UTD.htm?9/54/10083?source=see_link\">",
"     \"Chapter 6J: Erythropoietin\"",
"    </a>",
"    .)",
"   </p>",
"   <p>",
"    (From Rose, BD, Post, TW. Clinical Physiology of Acid-Base and Electrolyte Disorders, 5th ed, McGraw-Hill, New York, 2001.)",
"   </p>",
"  </div>",
