"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Multiple pulmonary nodules (The Basics)",
"    </div>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H592656662\">",
"      <span class=\"h1\">",
"       What are multiple pulmonary nodules?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Pulmonary nodules, also called lung nodules, are &ldquo;spots&rdquo; on the lungs that are seen on a chest X-ray or CT scan. A CT scan is an imaging test that creates pictures of the inside of the body. When there are 2 or more spots on the lungs, it&rsquo;s called &ldquo;multiple&rdquo; pulmonary nodules.",
"     </p>",
"     <p>",
"      <strong>",
"       What causes multiple pulmonary nodules?",
"      </strong>",
"      &ndash; Multiple pulmonary nodules are caused by either:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Cancer &ndash; Multiple pulmonary nodules can be caused by cancer that started in another part of the body and then spread to the lungs. Sometimes, multiple pulmonary nodules are caused by other types of cancer, called lymphoma or sarcoma.",
"       </li>",
"       <li>",
"        Conditions that are not cancer &ndash; These include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Different types of infections",
"       </li>",
"       <li>",
"        Conditions that involve inflammation, such as sarcoidosis or granulomatosis with polyangiitis",
"       </li>",
"       <li>",
"        Clumps of abnormal blood vessels, called arteriovenous malformations (or &ldquo;AVMs&rdquo; for short)",
"       </li>",
"       <li>",
"        Conditions caused by breathing in harmful substances for many years",
"       </li>",
"       <li>",
"        Conditions caused by using illegal drugs like heroin",
"       </li>",
"       <li>",
"        Scars from an old infection that happened years ago, such as from a fungus, tuberculosis, or chicken pox",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H592656677\">",
"      <span class=\"h1\">",
"       How will my doctor know what is causing my pulmonary nodules?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To help figure this out, your doctor will ask about your symptoms and other medical conditions. He or she will want to know whether you worked around harmful substances you could have breathed into your lungs. If you have not had a CT scan done, he or she will order this test.",
"     </p>",
"     <p>",
"      Your doctor will look at your X-ray and CT scan to see the sizes and shapes of the spots, and where they are in your lungs. He or she might be able to tell the cause of the nodules based on this information.",
"     </p>",
"     <p>",
"      If you have old chest X-rays or CT scans, he or she will look at those to see whether the spots have changed over time. If the spots have not changed on CT scans from 2 years ago (or longer), they are unlikely to be cancer. They are most likely a type of scar on the lungs.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H592656692\">",
"      <span class=\"h1\">",
"       Will my doctor order more tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If your doctor suspects that you have cancer, an infection, or inflammation, he or she will order more tests. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        A skin test for tuberculosis",
"       </li>",
"       <li>",
"        Lab tests on samples of mucus that you cough up",
"       </li>",
"       <li>",
"        An imaging test called a PET scan &ndash; If some of the nodules are",
"        <span class=\"nowrap\">",
"         1/3",
"        </span>",
"        of an inch or bigger, your doctor might order a PET scan. For this test, a doctor puts a substance into your vein through a thin tube called an &ldquo;IV.&rdquo; Then a special camera takes pictures of your lungs. This test can help tell whether pulmonary nodules are likely to be cancer.",
"       </li>",
"       <li>",
"        A procedure called bronchoscopy &ndash; For this test, your doctor will put a thin tube with a camera and light on the end (called a &ldquo;bronchoscope&rdquo;) in your mouth and down into your lungs. During this test, he or she can get samples of mucus from deep inside your lungs. Another doctor will look at the samples under a microscope and do lab tests on them.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If the results of these tests are unclear and there is a chance that the nodules are cancer or a disease that needs treatment (like an infection), your doctor will do a biopsy. A biopsy is a test that can tell for certain what&rsquo;s causing your pulmonary nodules. During a biopsy, your doctor will get a sample of tissue from 1 of your pulmonary nodules. Then another doctor will look at the sample under a microscope.",
"     </p>",
"     <p>",
"      There are different ways a doctor can do a biopsy. To get a sample of tissue from a pulmonary nodule, your doctor can:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Put a needle through your chest and into a nodule in your lungs",
"       </li>",
"       <li>",
"        Do bronchoscopy to get a sample of tissue",
"       </li>",
"       <li>",
"        Do surgery to remove a pulmonary nodule",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H592656707\">",
"      <span class=\"h1\">",
"       What happens next?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Based on your test results and individual situation, your doctor will decide if you need treatment for the nodules.",
"     </p>",
"     <p>",
"      If your nodules are caused by a condition that needs treatment, your doctor will talk with you about what he or she recommends.",
"     </p>",
"     <p>",
"      If your doctor thinks your nodules are a scar on your lungs, you probably won&rsquo;t need treatment. But you might need follow-up visits or CT scans to make sure your condition doesn&rsquo;t change or worsen over time. How often the scans are done depends on your individual situation. Most people have repeat CT scans over the course of about 2 years.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H592656724\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?34/34/35363?source=see_link\">",
