"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"./kaposi-sarcoma-the-basics?source=see_link\">",
"       Patient information: Kaposi sarcoma (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?23/1/23570?source=see_link\">",
"       Patient information: Single pulmonary nodule (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?1/3/1076?source=see_link\">",
