var content_f24_23_24956=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F74180&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F74180&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Valproate toxicity: Rapid overview",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical presentation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CNS depression (acute overdose or therapeutic use)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypotension (severe acute overdose)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Metabolic acidosis (severe acute overdose)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Electrolyte abnormalities (acute overdose)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Elevated transaminase levels (therapeutic use)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperammonemia (therapeutic use)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Idiosyncratic hepatotoxicity (therapeutic use)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        History",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Amount ingested; immediate or sustained release preparation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Concurrent carnitine supplementation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Examination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        CNS depression, stigmata of hepatotoxicity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Laboratory",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Measure valproate level every 2-4 hours until declining; check acid-base status, liver function tests, ammonia level",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Treatment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Gastrointestinal decontamination",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Single dose (1 g/kg) or multiple dose (0.5 g/kg every 8 hours x 4) charcoal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Hypotension in acute overdose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fluid resuscitation; vasopressors if necessary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Consider hemodialysis or hemoperfusion for refractory hypotension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Hyperammonemia, with or without encephalopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Carnitine, 50 mg/kg/day PO or IV divided TID",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Idiosyncratic hepatotoxicity (Reye's-like illness)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Supportive care, carnitine 50 mg/kg/day IV divided TID",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        CNS depression in acute overdose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Supportive care",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f24_23_24956=[""].join("\n");
var outline_f24_23_24956=null;
var title_f24_23_24957="Discussing hospice care";
var content_f24_23_24957=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PALC%2F87287&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PALC%2F87287&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guide to discussing hospice care with patients",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup width=\"20%\">",
"     </colgroup>",
"     <colgroup width=\"80%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Identify other decision makers",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         \"Is there anyone you rely on to help you make important decisions?\"",
"        </p>",
"        \"Who in the family should be there with us when we discuss the results?\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Assess understanding of prognosis",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         \"What have your other doctors told you about your condition?\"",
"        </p>",
"        <p>",
"         \"Have they talked to you about what this latest problem might mean for you?\"",
"        </p>",
"        \"From what you know, do you think that over the next month your cancer will get better, worse, or stay the same?\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Define the patient's goals for care",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         \"What do you hope for most in the next few months?\"",
"        </p>",
"        \"Is there anything that you're afraid of?\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Reframe goals",
"        </strong>",
"       </td>",
"       <td>",
"        \"I wish we could guarantee that we could keep you alive until your daughter's graduation, but unfortunately we can't. Perhaps we can work together on a letter for her to read on that day, so she will know you are there in spirit in case you cannot be there.\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Identify needs for care",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         \"It can be very difficult to care for a family member at home, and no one can do it alone. Have you thought about what kinds of help you might need?\"",
"        </p>",
"        <p>",
"         \"Would it help if we could find a way to deliver your medications to you?\"",
"        </p>",
"        \"Would it reassure you if we could send a nurse out to your home to check on you?\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Summarize and link goals with care needs",
"        </strong>",
"       </td>",
"       <td>",
"        \"So I think I understand that your main goal is to stay at home and spend time with your family. To do that, we will need to help you in several ways, for instance, by sending a nurse out to your home and giving you both some help around the house. Is that right?\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Introduce hospice",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         \"One of the best ways to give you the help that you will need to stay at home with your family is a program called hospice. Have you heard of hospice?\"",
"        </p>",
"        <p>",
"         \"Hospice is able to provide more services and support at home than most other home care programs.\"",
"        </p>",
"        \"The hospice team has a lot of experience caring for seriously ill patients at home.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        <strong>",
"         Respond to emotions elicited and provide closure",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Acknowledge response",
"       </td>",
"       <td>",
"        <p>",
"         \"You seemed surprised to learn how sick you are.\"",
"        </p>",
"        \"I can see it's not easy for you to talk about hospice.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Legitimize reaction",
"       </td>",
"       <td>",
"        \"Many people are understandably upset when they learn how ill their loved one is and that hospice is a possibility.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Empathize",
"       </td>",
"       <td>",
"        \"I can imagine how hard this is for both of you; you care about each other so much.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Explore concerns",
"       </td>",
"       <td>",
"        \"Tell me what's upsetting you the most.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Explain hospice goals",
"       </td>",
"       <td>",
"        <p>",
"         \"Hospice doesn't help people die sooner. Hospice helps people die naturally, in their own time.\"",
"        </p>",
"        \"Hospice helps people live as well as they can for as long as they can.\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td class=\"indent1\">",
"        Reassure",
"       </td>",
"       <td>",
"        <p>",
"         \"Hospice's goal is to improve your quality of life as much as possible for whatever time you have left.\"",
"        </p>",
"        \"Hospice can help you and your family make the most of the time you have left.\"",
"       </td>",
"      </tr>",
"      <tr class=\"divider_bottom\">",
"       <td>",
"        <strong>",
"         Reinforce commitment to care",
"        </strong>",
"       </td>",
"       <td>",
"        \"Let's think this over for a day or two; you know I will continue to care for you whatever decision you make.\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Recommend hospice",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         \"I think that hospice would be your best choice right now, but of course, the final decision is yours.\"",
"        </p>",
"        \"Hospice could be very helpful to you in the ways that we've talked about, but I realize it's a big decision. I'd like to arrange for a hospice nurse to visit you so you can decide for yourself whether hospice is right for you.\"",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Casarett DJ, Quill TE. \"I'm Not Ready for Hospice\": Strategies for Timely and Effective Hospice Discussions. Ann Intern Med 2007; 146:443. Copyright &copy; 2007 American College of Physicians.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
